import React from "react";

export default function About(){
    return(
        <div className="about-container">
        <h1 data-aos = "fade-up">This section is exclusive to my backround</h1>
        <p data-aos = "fade-up">Hello visitor! This is Mohammad Adnan. I am a student pursuing bachelors in Computer Science and Engineering from IIT Palakkad, India. As you can interpret I am very much interested in learning new technologies<span> check my skills </span> and I keep on implementing those technologies to create something creative ;) </p>
        <p data-aos = "fade-up">I have 2+ years of experience in Web development and have recently started working in Android development. Apart from that I am trying to do my best in becoming an expert in programming and DSA.</p>
        <p data-aos = "fade-up">Also I have recently started a youtube channel where I teaches all the coding skills that I know about. You can jump to my<span> Youtube channel </span>if you are interested in learning programming and are a beginner.</p>
        </div>
    )
}
